INSERT INTO `acl_data_source` (`id`, `name`, `table`, `fields`, `id_conection`, `status`, `filter`, `is_dynamic`, `table_description`) VALUES
	(2, 'HISTAH_TRIMESTRAL', 'HISTAH_TRIMESTRAL', 'SET SAFETY OFF\nSET PASSWORD 1 TO "consclientes"\n\nIMPORT ODBC SOURCE "SIG" TABLE "HISTAH" QUALIFIER "BRRD" OWNER "SIG" USERID "clientes"  WHERE "FETRANS >= TRUNC(ADD_MONTHS(sysdate,-3), \'mm\')" PASSWORD 1 TO "HISTAH_TRIMESTRAL.FIL" WIDTH 500 MAXIMUM 100\n\n\nQUIT\n', 4, 0, NULL, 1, NULL),
	(3, 'HISTAH_ANUAL', 'HISTAH_ANUAL', 'SET SAFETY OFF\nSET PASSWORD 1 TO "consclientes"\n\nIMPORT ODBC SOURCE "SIG" TABLE "HISTAH" QUALIFIER "BRRD" OWNER "SIG" USERID "clientes"  WHERE "FETRANS >= TRUNC(ADD_MONTHS(sysdate,-12), \'mm\')" PASSWORD 1 TO "HISTAH_ANUAL.FIL" WIDTH 500 MAXIMUM 100\n\n\nQUIT\n', 4, 0, NULL, 1, NULL),
	(4, 'PPMPR', 'PPMPR', 'OPEN PPMPR\r\n\n\r\nDEFINE FIELD c_Estatus      COMPUTED \r\n\r\n "LINEA BANRESERVAS" IF PCL_ADMIN=\'00\'\r\n "VIGENTE" IF VALUE(PCL_ADMIN; 0)= 1\r\n "VENCIDO" IF PCL_ADMIN=\'02\'\r\n "DEMORADO" IF PCL_ADMIN=\'03\'\r\n "INCOBRABLE" IF PCL_ADMIN=\'04\'\r\n "POR RENOVAR" IF PCL_ADMIN=\'05\'\r\n "RENOVADO" IF PCL_ADMIN=\'06\'\r\n "CARTERA VENCIDA" IF PCL_ADMIN=\'07\'\r\n "DUDOSO COBRO" IF PCL_ADMIN=\'08\'\r\n "LIQUIDADO" IF PCL_ADMIN=\'09\'\r\n "TRANSFERIDOS" IF PCL_ADMIN=\'10\'\r\n "SALDO NORMAL" IF PCL_ADMIN=\'11\'\r\n "SALDO EN LEGAL" IF PCL_ADMIN=\'12\'\r\n "SALDO CARTERA VENCIDA" IF PCL_ADMIN=\'13\'\r\n "SALDO DUDOSO COBRO" IF PCL_ADMIN=\'14\'\r\n "SALDO POR EL BANCO" IF PCL_ADMIN=\'15\'\r\n "INTERESES EXTRA LIBRO" IF PCL_ADMIN=\'16\'\r\n "POR TRANSFERIR" IF PCL_ADMIN=\'17\'\r\n "EN LEGAL" IF PCL_ADMIN=\'18\'\r\n "PAGO POR GARANTE" IF PCL_ADMIN=\'19\'\r\n "SALDO POR GARANTE" IF PCL_ADMIN=\'20\'\r\n "SALDO A" IF PCL_ADMIN=\'22\'\r\n "N/A"\r\n\n\r\nComment :: Creacion del campo computado numero de prestamo\r\n\nDEFINE FIELD c_No_Prestamo COMPUTED  STRING(PCU_PRODU; 3;"009" )+"-"+STRING( PCU_MONED; 2;"09" )+"-"+STRING( PCU_OFICI ; 3;"009" )+"-"+STRING( PCUNUMCUE; 6;"000009" )+"-"+STRING( PCUDIGVER; 1 )\r\n\r\nDEFINE FIELD Linea_Credito COMPUTED  STRING(LCU_PRODU; 3;"009" )+"-"+STRING(LCU_MONED; 2;"09" )+"-"+STRING( LCU_OFICI ; 3;"009" )+"-"+STRING( LCUNUMCUE; 6;"000009" )+"-"+STRING( LCUDIGVER; 1 )\r\n\r\nDEFINE FIELD c_Numero_Cuenta COMPUTED  STRING(ACU_PRODU; 3;"009" )+"-"+STRING(ACU_MONED; 2;"09" )+"-"+STRING( ACU_OFICI ; 3;"009" )+"-"+STRING( ACUNUMCUE; 6;"000009" )+"-"+STRING( ACUDIGVER; 1 )\n\r\n\r\nComment :: Campo computado para la fecha de vencimiento del prÃ©stamo\n\r\nDEFINE FIELD c_Fecha_Vencimiento COMPUTED \r\nWIDTH 14  \r\nCTOD(SUBSTR( STRING(PFEVENPAG; 8; "00000009");1;4) + "/" + SUBSTR( STRING(PFEVENPAG; 8; "00000009");5;2) + "/" + SUBSTR(STRING(PFEVENPAG; 8; "00000009");7;2); "YYYY/MM/DD")\r\n\r\nComment :: Campo computado para la fecha de desembolso del prÃ©stamo\r\n\nDEFINE FIELD c_Fecha_Desembolso COMPUTED \r\nWIDTH 14  \r\nCTOD(SUBSTR( STRING(PFE_LIQUI; 8; "00000009");1;4) + "/" + SUBSTR( STRING(PFE_LIQUI; 8; "00000009");5;2) + "/" + SUBSTR(STRING(PFE_LIQUI; 8; "00000009");7;2); "YYYY/MM/DD")', 1, 1, 'ESTADO<>\'N\'', NULL, NULL),
	(5, 'HISTAH_HISTORICO', 'HISTAH_HISTORICO', 'SET SAFETY OFF\nSET PASSWORD 1 TO "consclientes"\n\nIMPORT ODBC SOURCE "SIG" TABLE "HISTAH" QUALIFIER "BRRD" OWNER "SIG" USERID "clientes"  WHERE "FETRANS >= TRUNC(ADD_MONTHS(sysdate,-36), \'mm\')" PASSWORD 1 TO "HISTAH_HISTORICO.FIL" WIDTH 500 MAXIMUM 100\n\n\nQUIT\n', 4, 1, NULL, 1, NULL),
	(6, 'AHMAH', 'AHMAH', 'OPEN AHMAH\r\n\r\nComment :: Creacion del campo computado numero de cuenta Ahorro\r\nDEFINE FIELD c_Cuenta_Ahorro COMPUTED  \r\n\r\nSTRING(HCU_PRODU ; 3;"009" )+"-"+STRING( HCU_MONED; 2;"09" )+"-"+STRING( HCU_OFICI ; 3;"009" )+"-"+STRING( HCUNUMCUE; 6;"000009" )+"-"+STRING( HCUDIGVER; 1 )\r\n\r\n\r\nDEFINE FIELD C_Estatus      COMPUTED \n\n " " IF HCOESTCUE=0\n "ACTIVA" IF hcoestcue=1\n "INACTIVA" IF hcoestcue=2\n "CERRADA" IF hcoestcue=3\n "CANCELADA" IF hcoestcue=4\n "POR CERRAR" IF hcoestcue=5\n "FUERA DE CICLO" IF hcoestcue=6\n "N/A"', 1, 1, 'ESTADO<>\'N\'', NULL, NULL),
	(7, 'BSMCL', 'BSMCL', 'OPEN BSMCL\r\n\nDEFINE FIELD c_Tipo_ID      COMPUTED \nWIDTH 3  \n "CEDULA HOMBRE" IF SCOTIPIDE = 1\n "CEDULA MUJER" IF SCOTIPIDE = 2\n "RNC" IF SCOTIPIDE = 3\n "PASAPORTE" IF SCOTIPIDE = 4\n "OTRA IDENT." IF SCOTIPIDE = 5\n "CEDULA" IF SCOTIPIDE = 6\n "MENOR DE EDAD" IF SCOTIPIDE = 7\n "N/A"\r\n\r\nOPEN BSMCL\n\r\nDEFINE FIELD c_Fecha_Creacion COMPUTED CTOD(SUBSTR( STRING(TFECREREG; 8; "00000009");1;2) + "/" + SUBSTR( STRING(TFECREREG; 8; "00000009");3;2) + "/" + SUBSTR(STRING(TFECREREG; 8; "00000009");5;4); "DD/MM/YYYY")', 1, 1, 'ESTADO<>\'N\'', NULL, NULL),
	(8, 'BSRCC', 'BSRCC', '', 1, 1, 'ESTADO<>\'N\'', NULL, NULL),
	(9, 'MPUR', 'MPUR', NULL, 2, 1, NULL, NULL, NULL),
