	(11, 'FFMDE', 'FFMDE', 'Comment :: Definiendo campo para saber la fecha en que se aperturo el certificado\r\nOPEN FFMDE\r\nDEFINE FIELD c_Fecha_Apertura COMPUTED \r\nWIDTH 15  \r\nCTOD(SUBSTR( STRING(FFE_ORIGI8; 8; "00000009");1;2) + "/" + SUBSTR( STRING(FFE_ORIGI8; 8; "00000009");3;2) + "/" +SUBSTR( STRING(FFE_ORIGI8; 8; "00000009");5;4); "DD/MM/YYYY")\r\n\r\nComment :: Campo computado para el numero de certificado\r\nDEFINE FIELD c_No_Certificado COMPUTED  STRING(FCU_PRODU; 3;"009" )+"-"+STRING( FCU_MONED; 2;"09" )+"-"+STRING( FCU_OFICI ; 3;"009" )+"-"+STRING( FCUNUMCUE; 6;"000009" )+"-"+STRING( FCUDIGVER; 1 )', 1, 1, NULL, NULL, NULL),
