	(14, 'ESP_CONTRATO', 'ESP_CONTRATO', 'OPEN ESP_CONTRATO\r\nDEFINE FIELD c_No_Contrato  COMPUTED  ID_CTR\r\nDEFINE FIELD c_Cliente_CTR  COMPUTED  ID_CLIENTE_CTR\r\nDEFINE FIELD c_Moneda       COMPUTED  ID_MONEDA_CTR\r\nDEFINE FIELD c_Numero_Prestamo COMPUTED  SUBSTR( CODIGO_BANRESERVAS_CTR; 1; 3 ) + "-" + SUBSTR( CODIGO_BANRESERVAS_CTR; 4; 2 )  + "-" + SUBSTR( CODIGO_BANRESERVAS_CTR; 6; 3 )  + "-" + SUBSTR( CODIGO_BANRESERVAS_CTR; 9;6 ) + "-" + SUBSTR( CODIGO_BANRESERVAS_CTR; 15; 1)', 5, 1, '', NULL, NULL),
