	(16, 'ESP_RELACION_GARANTIA_PROP', 'ESP_RELACION_GARANTIA_PROP', 'OPEN ESP_RELACION_GARANTIA_PROP\r\n\r\nDEFINE FIELD c_No_Garantia_RGP  COMPUTED  ID_GARANTIA_RGP\r\nDEFINE FIELD c_No_Propiedad_RGP COMPUTED  ID_PROPIEDAD_RGP\r\nDEFINE FIELD c_No_Contrato_RGP  COMPUTED  ID_CONTRATO_RGP\r\n\r\nDEFINE FIELD c_Vigente      COMPUTED \n\n "Si" IF ELIMINADO_RGP="N"\n "No"', 5, 1, '', NULL, NULL),
	(17, 'ESP_VINCULACION', 'ESP_VINCULACION', 'OPEN ESP_VINCULACION\r\nDEFINE FIELD c_No_Garantia_VIN  COMPUTED  ID_REGISTRO_GARANTIA_VIN\r\nDEFINE FIELD c_No_Producto_VIN COMPUTED  PRODUCTO_VIN\r\nDEFINE FIELD c_Cliente_VIN      COMPUTED  ID_CLIENTE_VIN', 5, 1, '', NULL, NULL),
