	(20, 'ESP_PROPIEDAD', 'ESP_PROPIEDAD', 'OPEN ESP_PROPIEDAD\r\nDEFINE FIELD c_No_Propiedad COMPUTED  ID_PRO\r\nDEFINE FIELD c_Descripcion_Propiedad COMPUTED  DESCRIPCION_PRO\r\nDEFINE FIELD c_Cliente_Prod COMPUTED  ID_CLIENTE_PRO\r\nDEFINE FIELD c_Valor_Garantia COMPUTED VALOR_PROPIEDAD_PRO\r\nDEFINE FIELD c_Moneda COMPUTED ID_MONEDA_PRO\r\nDEFINE FIELD c_Tipo_Propiedad COMPUTED ID_TIPO_PROPIEDAD_PRO\r\nDEFINE FIELD c_SubTipo_Propiedad COMPUTED ID_SUBTIPO_PROPIEDAD_PRO\r\n\r\n\r\nDEFINE FIELD c_No_Garantia_SFB  COMPUTED  SUBSTR( CODIGO_BANRESERVAS_PRO; 1; 3 ) + "-" + SUBSTR( CODIGO_BANRESERVAS_PRO; 4; 2 )  + "-" + SUBSTR( CODIGO_BANRESERVAS_PRO; 6; 3 )  + "-" + SUBSTR( CODIGO_BANRESERVAS_PRO; 9;6 ) + "-" + SUBSTR( CODIGO_BANRESERVAS_PRO; 15; 1)', 5, 1, '', NULL, NULL),
